// React
import React, { useEffect } from 'react';
// Redux and Redux logic
import { useSelector, useDispatch } from 'react-redux'
import { fetchVideoconferencias, fetchVideoconferenciasByDate } from '../../reducers/videoconferenciaSlice'
import { useAuthentication } from '../../hooks/useAuthentication';
// Moment
import moment from 'moment'
// PDFMake
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
pdfMake.vfs = pdfFonts.pdfMake.vfs;
// Next
import { useRouter } from 'next/router'

export default function Pauta() {
    useAuthentication({ redirectTo: '/login' })
    const router = useRouter();
    const workingDate = router.query.date
    const videoconferencias = useSelector(state => state.videoconferencia.videoconferencias)
    const dispatch = useDispatch()
    useEffect(() => {
        if (workingDate) {
            dispatch(fetchVideoconferenciasByDate(workingDate));
        }
        else {
            dispatch(fetchVideoconferencias());
        }
    }, [workingDate])
    const styles = {
        header: {
            fontSize: 12,
            bold: true
        },
        subheader: {
            fontSize: 12
        }
    }
    let videoconferenciasTable = [
        [
            { text: 'Nome', bold: true },
            { text: 'Hora', bold: true },
            { text: 'Solicitante', bold: true },
            { text: 'Sala', bold: true },
            { text: 'Ala', bold: true },
            { text: 'Cela', bold: true },
        ]
    ]
    const videoconferenciasForPrinting = () => {
        return videoconferencias.map((videoconferencia) => {
                const { solicitante, data_e_hora, sala, presos } = videoconferencia;
                presos.map((preso) => {
                    return videoconferenciasTable.push([
                        preso.nome,
                        moment(data_e_hora).format('H[h]m[min]'),
                        solicitante,
                        sala,
                        preso.ala,
                        preso.cela
                    ])
                })
            })
    }
    const printContent = () => {
        const docDefinition = {
            info: {
                title: 'Relat√≥rio'
            },
            pageSize: 'A4',
            pageMargins: [40, 215, 40, 60],
            header: [
                {
                    image: 'data:image/png;base64,',
                    margin: [0, 30, 0, 0],
                    width: 125,
                    alignment: 'center'
                },
                {
                    text: ['Unidade Prisional Regional de Sobral', '\n', 'Pauta de Videoconfer√™ncia', '\n', moment(workingDate).format('DD/MM/YYYY') + '\n\n'],
                    alignment: 'center',
                    bold: true
                },
            ],
            footer: function (currentPage, pageCount) {
                return {
                    columns: [
                        {
                            text: 'Impresso em ' + moment().format('DD/MM/YYYY [√†s] H[h]m[min]') + '.',
                            fontSize: 10,
                            margin: [40, 0]
                        },
                        {
                            text: `${currentPage}/${pageCount}`,
                            fontSize: 10,
                            alignment: 'right',
                            margin: [40, 0]
                        },
                    ]
                }
            },
            content: [
                {
                    table: {
                        widths: ['*', 'auto', 'auto', 'auto', 'auto', 'auto'],
                        body: videoconferenciasTable,
                    },
                    layout: 'lightHorizontalLines'
                }
            ],
            styles
        }
        pdfMake.createPdf(docDefinition).open({}, window)
    }
    useEffect(() => {
        videoconferenciasForPrinting();
        videoconferencias.length > 0 && printContent();
    }, [videoconferencias, workingDate])
    return null;
}